// HomeCookedMeals.js
import React from 'react';

function HomeCookedMeals() {
  return (
    <div>
      <h2>Comidas Caseras para Mascotas</h2>
      <p>Aquí puedes encontrar una selección de comidas caseras nutritivas para tus mascotas.</p>
    </div>
  );
}

export default HomeCookedMeals;
